import React from 'react';
import { Card, Button, Pagination } from 'react-bootstrap';
import { ArrowRight } from 'react-bootstrap-icons';

const ProjectList = ({ projects, onProjectSelect, currentPage, totalPages, onPageChange }) => {
  return (
    <div className="container py-4">
      <h4 className="mb-4">Proyectos</h4>
      {projects.map((project) => (
        <Card key={project.uid} className="border-0 mb-3 shadow-sm">
          <Card.Body>
            <div className="d-flex justify-content-between align-items-center">
              <div>
                <Card.Title className="mb-2">{project.name}</Card.Title>
                <Card.Text className="text-muted">
                  Descripci贸n: {project.settings?.description || 'Sin descripci贸n'}
                </Card.Text>
              </div>
              <Button 
                variant="outline-primary" 
                size="sm" 
                onClick={() => onProjectSelect(project.uid)}
              >
                <ArrowRight /> Ver encuestas
              </Button>
            </div>
          </Card.Body>
        </Card>
      ))}

      {/* Paginaci贸n */}
      <Pagination className="mt-4 justify-content-center">
        <Pagination.Prev 
          disabled={currentPage === 1} 
          onClick={() => onPageChange(currentPage - 1)} 
        />
        {[...Array(totalPages)].map((_, index) => (
          <Pagination.Item 
            key={index + 1} 
            active={index + 1 === currentPage} 
            onClick={() => onPageChange(index + 1)}
          >
            {index + 1}
          </Pagination.Item>
        ))}
        <Pagination.Next 
          disabled={currentPage === totalPages} 
          onClick={() => onPageChange(currentPage + 1)} 
        />
      </Pagination>
    </div>
  );
};

export default ProjectList;
